import React, { useState } from "react";
import Header from "./component/header";

import {
  HomeIcon,
  FireIcon,
  UserGroupIcon,
  ArrowTrendingUpIcon,
} from "@heroicons/react/24/outline";

const AddOrganizationForm = () => {
  const [formData, setFormData] = useState({
    organizationName: "",
    type: "",
    location: "",
    description: "",
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData); // Process the submission here
    // Optionally reset form fields
    setFormData({
      organizationName: "",
      type: "",
      location: "",
      description: "",
    });
  };

  return (
    <div className="bg-white p-8 mt-6 rounded-lg shadow-lg max-w-full mx-auto">
      <form onSubmit={handleSubmit} className="space-y-6">
        <h2 className="text-2xl font-semibold text-gray-900">
          Add New Organization
        </h2>

        <div>
          <label
            htmlFor="organizationName"
            className="block text-sm font-medium text-gray-700"
          >
            Organization Name
          </label>
          <input
            type="text"
            name="organizationName"
            id="organizationName"
            value={formData.organizationName}
            onChange={handleChange}
            className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm placeholder-gray-400 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
            required
          />
        </div>

        {/* Row for Type and Location */}
        <div className="flex flex-col sm:flex-row gap-6">
          <div className="flex-1">
            <label
              htmlFor="type"
              className="block text-sm font-medium text-gray-700"
            >
              Type
            </label>
            <select
              name="type"
              id="type"
              value={formData.type}
              onChange={handleChange}
              className="mt-1 block w-full px-3 py-2 border border-gray-300 bg-white rounded-md shadow-sm focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
              required
            >
              <option value="">Select Type</option>
              <option value="nonprofit">Nonprofit</option>
              <option value="forprofit">For-profit</option>
              <option value="government">Government</option>
            </select>
          </div>

          <div className="flex-1">
            <label
              htmlFor="location"
              className="block text-sm font-medium text-gray-700"
            >
              Location
            </label>
            <input
              type="text"
              name="location"
              id="location"
              value={formData.location}
              onChange={handleChange}
              className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm placeholder-gray-400 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
              required
            />
          </div>
        </div>

        <div>
          <label
            htmlFor="description"
            className="block text-sm font-medium text-gray-700"
          >
            Description
          </label>
          <textarea
            name="description"
            id="description"
            value={formData.description}
            onChange={handleChange}
            className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm placeholder-gray-400 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
            rows="4"
            required
          ></textarea>
        </div>

        <button
          type="submit"
          className="w-full bg-indigo-600 text-white px-4 py-2 rounded-md hover:bg-indigo-700 focus:outline-none focus:bg-indigo-700"
        >
          Submit
        </button>
      </form>
    </div>
  );
};

const AdminForm = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    role: "",
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData); // Send this data to the server or handle it according to your needs
    // Reset form (optional)
    setFormData({
      name: "",
      email: "",
      role: "",
    });
  };

  return (
    <div className="bg-white p-8 mt-6 rounded-lg shadow-lg max-w-lg mx-auto">
      <form onSubmit={handleSubmit}>
        <h2 className="text-2xl font-semibold mb-6 text-gray-800">
          Add New User
        </h2>

        <div className="mb-4">
          <label
            htmlFor="name"
            className="block text-sm font-medium text-gray-700"
          >
            Name
          </label>
          <input
            type="text"
            name="name"
            id="name"
            value={formData.name}
            onChange={handleChange}
            className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm placeholder-gray-400 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
            required
          />
        </div>

        <div className="mb-4">
          <label
            htmlFor="email"
            className="block text-sm font-medium text-gray-700"
          >
            Email
          </label>
          <input
            type="email"
            name="email"
            id="email"
            value={formData.email}
            onChange={handleChange}
            className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm placeholder-gray-400 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
            required
          />
        </div>

        <div className="mb-6">
          <label
            htmlFor="role"
            className="block text-sm font-medium text-gray-700"
          >
            Role
          </label>
          <select
            name="role"
            id="role"
            value={formData.role}
            onChange={handleChange}
            className="mt-1 block w-full px-3 py-2 border border-gray-300 bg-white rounded-md shadow-sm focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
            required
          >
            <option value="">Select a role</option>
            <option value="admin">Admin</option>
            <option value="editor">Editor</option>
            <option value="viewer">Viewer</option>
          </select>
        </div>

        <button
          type="submit"
          className="w-full bg-indigo-600 text-white px-4 py-2 rounded-md hover:bg-indigo-700 focus:outline-none focus:bg-indigo-700"
        >
          Submit
        </button>
      </form>
    </div>
  );
};

const MessagesTable = () => {
  const messages = [
    {
      id: 1,
      sender: "John Doe",
      summary: "Regarding the upcoming project...",
      time: "Today, 3:45 PM",
    },
    {
      id: 2,
      sender: "Jane Smith",
      summary: "Updated contract details attached...",
      time: "Today, 1:15 PM",
    },
    {
      id: 3,
      sender: "Alice Johnson",
      summary: "Meeting reminder for tomorrow...",
      time: "Yesterday, 5:00 PM",
    },
    {
      id: 4,
      sender: "Michael Williams",
      summary: "Urgent issue resolved",
      time: "Yesterday, 2:34 PM",
    },
  ];

  const openMessage = (id) => {
    alert(`Opening message with ID: ${id}`);
  };

  return (
    <div className="bg-white p-8 mt-6 rounded-lg shadow-lg max-w-full mx-auto">
      <h2 className="text-xl font-semibold text-gray-800 mb-4">
        Incoming Messages
      </h2>
      {/* Table for larger screens */}
      <div className="hidden sm:block overflow-x-auto">
        <table className="min-w-full leading-normal">
          <thead>
            <tr>
              <th className="px-5 py-3 border-b-2 border-gray-200 bg-gray-100 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                Sender
              </th>
              <th className="px-5 py-3 border-b-2 border-gray-200 bg-gray-100 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                Summary
              </th>
              <th className="px-5 py-3 border-b-2 border-gray-200 bg-gray-100 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                Time Received
              </th>
              <th className="px-5 py-3 border-b-2 border-gray-200 bg-gray-100 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                Actions
              </th>
            </tr>
          </thead>
          <tbody>
            {messages.map((message) => (
              <tr key={message.id}>
                <td className="px-5 py-5 border-b border-gray-200 bg-white text-sm">
                  <div className="text-gray-900 whitespace-no-wrap">
                    {message.sender}
                  </div>
                </td>
                <td className="px-5 py-5 border-b border-gray-200 bg-white text-sm">
                  <div className="text-gray-700 whitespace-no-wrap">
                    {message.summary}
                  </div>
                </td>
                <td className="px-5 py-5 border-b border-gray-200 bg-white text-sm">
                  <div className="text-gray-500 whitespace-no-wrap">
                    {message.time}
                  </div>
                </td>
                <td className="px-5 py-5 border-b border-gray-200 bg-white text-sm">
                  <button
                    onClick={() => openMessage(message.id)}
                    className="text-indigo-600 hover:text-indigo-900 font-semibold"
                  >
                    Open
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Cards for smaller screens */}
      <div className="sm:hidden">
        {messages.map((message) => (
          <div key={message.id} className="p-4 bg-white rounded-lg shadow mb-4">
            <div className="font-semibold">{message.sender}</div>
            <div className="text-gray-500">{message.summary}</div>
            <div className="text-gray-400 text-xs">{message.time}</div>
            <button
              onClick={() => openMessage(message.id)}
              className="mt-2 text-indigo-600 hover:text-indigo-900 font-semibold py-2 px-4 rounded-lg focus:outline-none focus:bg-indigo-100"
            >
              Open
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

const DashboardLayout = () => {
  const mainLinks = [
    { name: "Home", icon: HomeIcon, current: true },
    { name: "Events", icon: FireIcon, current: false },
    { name: "Organizations", icon: ArrowTrendingUpIcon, current: false },
    { name: "Profile", icon: UserGroupIcon, current: false },
  ];

  const communityLinks = ["Users", "Tickets", "Invitations", "Cash"];

  const stats = [
    { name: "Total Users", figure: "1,201", icon: UserGroupIcon },
    { name: "Total Events", figure: "7", icon: FireIcon },
    { name: "Total Tickets", figure: "15,000", icon: ArrowTrendingUpIcon },
    { name: "Total Organizations", figure: "124", icon: HomeIcon },
  ];

  return (
    <div className="flex min-h-screen">
      <div className="hidden lg:block lg:col-span-3 xl:col-span-2 bg-white p-4 shadow">
        <nav
          aria-label="Sidebar"
          className="sticky top-4 divide-y divide-gray-300"
        >
          <div className="space-y-1 pb-8">
            {mainLinks.map((link) => (
              <a
                href="#"
                key={link.name}
                className={`flex items-center px-3 py-2 text-sm font-medium rounded-md ${
                  link.current
                    ? "bg-gray-200 text-gray-900"
                    : "text-gray-700 hover:bg-gray-50"
                }`}
              >
                <link.icon className="text-gray-500 flex-shrink-0 -ml-1 mr-3 h-6 w-6" />
                <span className="truncate">{link.name}</span>
              </a>
            ))}
          </div>
          <div className="pt-10">
            <p
              className="px-3 text-sm font-medium text-gray-500"
              id="communities-headline"
            >
              Super Admin
            </p>
            <div
              className="mt-3 space-y-2"
              aria-labelledby="communities-headline"
            >
              {communityLinks.map((link) => (
                <a
                  href="#"
                  key={link}
                  className="group flex items-center rounded-md px-3 py-2 text-sm font-medium text-gray-700 hover:bg-gray-50"
                >
                  <span className="truncate">{link}</span>
                </a>
              ))}
            </div>
          </div>
        </nav>
      </div>

      <div className="flex-1 bg-gray-100 p-7">
        <h1 className="text-2xl font-semibold text-gray-800">
          Dashboard Overview
        </h1>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-4 mt-5">
          {stats.map((stat, idx) => (
            <div
              key={idx}
              className="relative bg-gray-800 p-5 rounded-lg shadow"
            >
              <div className="flex items-center space-x-3">
                <stat.icon className="h-8 w-8 text-white" />
                <div className="flex-1 min-w-0">
                  <p className="text-md font-medium text-white truncate">
                    {stat.name}
                  </p>
                  <p className="text-lg font-semibold text-gray-100">
                    {stat.figure}
                  </p>
                </div>
              </div>
            </div>
          ))}
        </div>

        <MessagesTable />
      </div>
    </div>
  );
};

const Dashboard = () => {
  return (
    <>
      <Header />

      <DashboardLayout />
    </>
  );
};

export default Dashboard;
